import { Container, Col, Row } from 'react-bootstrap';
import Jumbotron from '../Components/Jumbotron';

class HomePage extends Component {
  render() {
      return (

      <div className="App">

              <Jumbotron />

              <h1>Home Page</h1>


              <Jumbotron />

              </div>

    );
  }
}

export default HomePage;
